import styled from 'styled-components';

export const Input = styled.input`
  padding: 10px;
  border: 2px solid #0a398d;
  border-radius: 10px;
  font-size: 16px;
  outline: none;
  width: 400px;
  align-content: center;
  text-align: center;

  color: #0a398d;
`;
